import React from "react";
import { Card } from "react-bootstrap";

const CompanyCard = ({ companies }) => {
  return (
    <Card>
      <Card.Body>
        <Card.Title></Card.Title>
        <Card.Text>
          <strong>ID:</strong> {companies.companies_id} <br />
          <strong>Type:</strong> {companies.type} <br />
          <strong>Subject:</strong> {companies.subject} <br />
          <strong>Address:</strong> {companies.address} <br />
          <strong>Index:</strong> {companies.index} <br />
          <strong>OGRN:</strong> {companies.ogrn} <br />
          <strong>Create Org Date:</strong> {companies.create_org_date} <br />
          <strong>Identifiers:</strong> {companies.identifiers} <br />
        </Card.Text>
      </Card.Body>
    </Card>
  );
};

export default CompanyCard;
